ner"], "2774": ["Щипцы кулинарные очень удобные.Я очень довольна.Рекомендую!!!", "2019-05-06T13:35:56.715493686Z", "черный", "0", 3, 0, 5, "Щипцы кулинарные", "Borner"], "2775": ["Спасибо за отзывы. Щипцы понравились🤗", "2019-05-02T08:43:06.77005801Z", "черный", "0", 3, 0, 5, "Щипцы кулинарные", "Borner"], "2776": ["Действительно очень удобные полностью поддерживаю все предидущие хорошие отзывы", "2019-04-30T12:13:25.659638643Z", "черный", "0", 3, 0, 5, "Щипцы кулинарные", "Borner"], "2777": ["Щипцы понравились, удобные в работе, качественные, мне как раз такие и нужны были. Я довольна покупкой.", "2019-04-28T13:32:24.810331926Z", "черный", "0", 3, 0, 5, "Щипцы кулинарные", "Borner"], "2778": ["Вещь рекомендую ", "2019-04-25T02:55:01.654825608Z", "черный", "0", 3, 0, 5, "Щипцы кулинарные", "Borner"], "2779": ["Щипцы просто БЛЕСК :) и больше мне сказать о них нечего :)\r\nНу ладно, еще добавлю, что офигенно удобно мизинчиком поддевать кольцо для фиксации, закрыл - отложил в сторону. Очень довольна.", "2019-04-20T20:19:58.360393342Z", "черный", "0", 3, 1, 5, "Щипцы кулинарные", "Borner"], "2780": ["Довольна приобретением.", "2019-04-14T12:40:44.180856455Z", "черный", "0", 4, 1, 5, "Щипцы кулинарные", "Borner"], "2781": ["Качество на троечку, обычные щипцы", "2019-04-10T19:01:59.970007522Z", "черный", "0", 6, 6, 3, "Щипцы кулинарные", "Borner"], "2782": ["Присоединяюсь только к положительным отзывам! Очень удобные! Лопаточки идеального размера! Заказала и маме. Силикон. Мешала в казане мясо, переворачивала пирожки.... все ок! СПАСИБО!", "2019-04-07T20:31:09.681610626Z", "черный", "0", 14, 2, 5, "Щипцы кулинарные", "Borner"], "2784": ["Сегодня купила щипцы и сразу опробовала. Жарила стейки из индейки. Удобно переворачивать мясо, к силикону не прилипает. Фиксатор удобный. В руке комфортно держать. Значка бренда  Borner на щипцах нет. Приобрела за 362 руб.", "2019-04-07T21:13:39.84541041Z", "черный", "0", 24, 3, 5, "Щипцы кулинарные", "Borner"], "2785": ["Щипцы замечательные! Как я и хотела. Удобные, держат продукты хорошо!", "2019-04-03T12:35:15.445211816Z", "черный", "0", 7, 0, 5, "Щипцы кулинарные", "Borner"], "2786": ["Уже вся коллекция щипцов от бернера есть- сказать нечего, вещь, как всегда,  на высоте.", "2019-04-03T10:57:41.446349656Z", "черный", "0", 12, 1, 5, "Щипцы кулинарные", "Borner"], "2787": ["Давно хотела такие щипцы, с фиксатором, наконец преобрела. Качество отличное, рекомендую.", "2019-04-02T21:06:32.564647168Z", "черный", "0", 29, 1, 5, "Щипцы кулинарные", "Borner"], "2788": ["Удобные щипцы. Мне понравился внешний вид и качество исполнения.", "2019-03-28T12:14:47.135341136Z", "черный", "0", 7, 1, 5, "Щипцы кулинарные", "Borner"], "2789": ["Очень хорошие щипцы. температуру фритюра выдержали на 5+. Крепкие, захват удобный. Спасибо", "2019-03-27T19:58:06.656316821Z", "черный", "0", 11, 3, 5, "Щипцы кулинарные", "Borner"], "2790": ["Брала на подарок на новоселье лопатку и щипцы. 2 из 2-х - косяк. Бёрнер - это РЕАЛЬНО круто????", "2019-03-21T10:59:10.959770233Z", "черный", "0", 6, 16, 4, "Щипцы кулинарные", "Borner"], "2791": ["Понравились. Раскрываются на удобную ширину. Фиксируются в закрытом состоянии, что удобно для хранения. Сами лопатки из силикона, не скользкие. В работе удобные, легко и плавно сжимаются и разжимаются. Качественные, никаких заусенец. Удачный размер: не маленькие и не большие, хорошо ложатся в руку.", "2019-03-18T11:17:51.020138636Z", "черный", "0", 40, 3, 5, "Щипцы кулинарные", "Borner"], "2792": ["Очень хорошие щипцы👍", "2019-02-14T12:32:52.506713895Z", "черный", "0", 7, 4, 5, "Щипцы кулинарные", "Borner"], "2793": ["Не плохие щипцы, но честно говоря р.300 им красная цена", "2019-02-12T18:12:44.571345213Z", "черный", "0", 9, 8, 4, "Щипцы кулинарные", "Borner"], "2794": ["Доставка супер быстрая! Щипцы в целости, без малейших изъянов.\nКачественные,  надежные, удобные.", "2019-02-11T09:08:35.200754929Z", "черный", "0", 40, 11, 5, "Щипцы кулинарные", "Borner"], "2795": ["Щипцы удобные, но кольцо болтается. Если лопатки повернуть вверх, кольцо выпадает и щипцы не открываются, приходится кольцо вставлять на место. Лопатки щипцов очень хорошо все подхватывают и удерживают. Я невнимательно прочла описание, думала, что щипцы силиконовые, как в наборе, но это пластик, который выдерживает температуру до 90 градусов. Щипцы к покупке рекомендую, просто у меня видимо заводской брак, слабая пружина.", "2017-12-02T13:10:29.957+03:00", "оранжевый", "0", 1, 17, 4, "Щипцы кухонные, до 220С", "AxWild"], "2796": ["Щипцы соответствуют фото и описанию, сделаны качественно, фиксатор работает исправно, но для меня не хватает длины рабочей части, салатные щипцы от Borner  удобнее, но они сталь-пластик, со временем оплавляются. Щипцы оставила, может приноровлюсь со временем:) Спасибо за скидку.", "2019-02-10T06:27:30.956113007Z", "черный", "0", 14, 6, 4, "Щипцы кулинарные", "Borner"], "2797": ["Щипцы отличные,качественные,есть фиксатор,что бы не раздвигались,когда висят, у  других фирм его нет(хранить не удобно).Очень довольна покупкой.", "2019-02-06T09:11:17.518415104Z", "черный", "0", 16, 7, 5, "Щипцы кулинарные", "Borner"], "2798": ["Очень удобные и Качественные", "2019-02-03T18:37:38.881110998Z", "черный", "0", 9, 6, 5, "Щипцы кулинарные", "Borner"], "2800": ["Понравились , удобные. Перед использованием читайте инструкцию, чтобы не сломать ", "2018-08-18T07:49:28.131481535Z", "оранжевый", "0", 1, 0, 5, "Щипцы кухонные, до 220С", "AxWild"], "2801": ["Щипцы кулинарные просто отличные, качество на высоте.Закажу еще для подарка.", "2018-05-16T12:43:57.785653877Z", "оранжевый", "0", 2, 1, 5, "Щипцы кухонные, до 220С", "AxWild"], "2802": ["они пластиковые. пластик тонкий. в описании написано, что возможно перевернуть жарящийся продукт, а на этикетке на писано не выше 100 градусов. я так понимаю эти щипцы подходят только для перемешивания салата. отказ.", "2018-01-30T13:58:09.22+03:00", "оранжевый", "0", 4, 5, 5, "Щипцы кухонные, до 220С", "AxWild"], "2803": ["Почему-то просмотрела, что они пластиковые. Нужны были силиконовые. Поэтому отказ.", "2018-04-02T11:59:35.741+03:00", "оранжевый", "0", 1, 0, 5, "Щипцы кухонные, до 220С", "AxWild"], "2804": ["Не поняла восторгов,- все болтается, никаких силиконовых вставок не нашла, одна пластмасса, да и на сталь это недоразумение не похоже.", "2018-04-01T00:49:40.991+03:00", "оранжевый", "0", 1, 2, 2, "Щипцы кухонные, до 220С", "AxWild"], "2805": ["Пластик тонкий. Предпочла силиконовые. Отказ в пользу другой модели.", "2018-03-31T20:03:46.66+03:00", "оранжевый", "0", 2, 0, 3, "Щипцы кухонные, до 220С", "AxWild"], "2809": ["Если был силикон, было бы лучше... ", "2018-03-14T16:25:24.055+03:00", "сиреневый", "0", 1, 0, 5, "Щипцы кухонные, до 220С", "AxWild"], "2810": ["Удобны в использовании. Хороший механизм фиксации сжатия. Минус - мерзотный цвет, но это ерунда )))", "2018-03-10T17:23:15.054+03:00", "сиреневый", "0", 0, 2, 5, "Щипцы кухонные, до 220С", "AxWild"], "2811": ["Щипцы отличные! Очень удобные и красивые!", "2018-03-01T17:29:29.897+03:00", "оранжевый", "0", 1, 0, 5, "Щипцы кухонные, до 220С", "AxWild"], "2812": ["отказ от товара. пластик низкого качества.  только для холодных продуктов. хотелось силиконовые щипцы.", "2018-02-20T17:12:01.486+03:00", "сиреневый", "0", 8, 4, 1, "Щипцы кухонные, до 220С", "AxWild"], "2813": ["в магазине стоит 167 рублей, все как у китайского и металл и исполнение, обидно что переплатила больше 100р, брала за 279 р", "2018-02-13T09:08:55.461+03:00", "оранжевый", "0", 5, 2, 3, "Щипцы кухонные, до 220С", "AxWild"], "2814": ["Бернер все удобно и качественно! Вот только пришли щипцы в упаковке,которая Бернеру не свойственна,просто запаянный пакет!? А я брала в подарок!", "2017-11-30T20:52:42.38+03:00", "сиреневый", "0", 20, 4, 5, "Щипцы кухонные, до 220С", "AxWild"], "2815": ["Это уже третьи кулинарные щипцы! Класс! Бернер есть Бернер!", "2018-02-04T19:46:56.965+03:00", "оранжевый", "0", 0, 2, 5, "Щипцы кухонные, до 220С", "AxWild"], "2816": ["Присоединяюсь к восторженным отзывам. Не предполагала, что такая мелочь, как кухонные щипцы может доставлять такое ощущение комфорта и удовольствия при использовании: удобно ложатся в руку, удобно мешать/переворачивать, удобно хранить, легко отмываются. А за 189 рублей - просто новогодний подарок)) Спасибо!", "2018-01-20T00:35:27.657+03:00", "оранжевый", "0", 16, 1, 5, "Щипцы кухонные, до 220С", "AxWild"], "2817": ["Вроде легкие, удобные. Не понравилось, что ручки внутри полые, с довольно острыми краями и выступающими деталями - будет сложно мыть, особенно от жира. Сами захватывающие концы щипцов моются легко. Не знаю, можно ли что-то переворачивать в масле или на горячей сковороде, или достать мясо из горячего бульона - все-таки пластик, и написано, что использовать до 100 градусов. Но, испекла печенье, снимала щипцами с горячего противня - хорошо захватывают, удобнее, чем лопаткой.", "2018-01-11T22:47:17.306+03:00", "оранжевый", "0", 31, 4, 5, "Щипцы кухонные, до 220С", "AxWild"], "2818": ["Не нашла на щипцах эмблемы Бернера, хотя в кисточке и в наборе кухонных принадлежностей эмблема на каждом предмете присутствовала.\r\nОтказалась, ибо хочется в качестве пластика быть уверенной.", "2018-01-08T19:40:24.387+03:00", "оранжевый", "0", 7, 2, 5, "Щипцы кухонные, до 220С", "AxWild"], "2819": ["Главное в покупке соотношение цена и качество. У Бёрнера это всегда в пользу покупателя. Не дорого, функционально. Бывают и другие по смыслу вещи, но всегда нужно помнить что на грош пятаков не купишь. Хороший товар, да еще и доставка на дом с курьером в цену засунута. Как они умудряются в такие маленькие деньги даже курьера и прочие услуги затащить? Доволен товаром.", "2018-01-07T10:41:04.657+03:00", "салатовый", "0", 19, 3, 5, "Щипцы кухонные, до 220С", "AxWild"], "2820": ["Давно хотела такие щипцы. Вполне обычные,простые и удобные", "2018-01-06T14:23:34.484+03:00", "оранжевый", "0", 17, 1, 5, "Щипцы кухонные, до 220С", "AxWild"], "2821": ["Не купила с большой скидкой, потому что на упаковке надпись: Не использовать при температуре выше 90 градусов. Материал не силикон.", "2017-12-15T13:32:44.12+03:00", "салатовый", "0", 8, 20, 3, "Щипцы кухонные, до 220С", "AxWild"], "2822": ["Не подходят для использования в \"горячих\" условиях: переворачивала гренки на сковородке - края щипцов подгорели/почернели. А ведь в описании указано \"перевернуть жарящийся продукт\".", "2017-12-10T04:06:15.942+03:00", "салатовый", "0", 11, 19, 3, "Щипцы кухонные, до 220С", "AxWild"], "2823": ["Как жаль, что не обратила внимание на ответы представителей фирмы, что наконечники из тонкой пластмассы. Но они уверяют, что выдерживают 100 С, а на самой упаковке написано- не более 90! \r\nДа и якобы прорезиненные ручки это ерунда, они видимо не видели по-настоящему прорезиненные или силиконовые ручки. Дешевка! Не стоят и 245 рублей. Возврат.", "2017-11-24T22:30:59.684+03:00", "салатовый", "0", 7, 19, 2, "Щипцы кухонные, до 220С", "AxWild"], "2824": ["Полностью согласна с отзывом Яны от 01 ноября.", "2017-11-10T12:46:04.78+03:00", "салатовый", "0", 4, 21, 3, "Щипцы кухонные, до 220С", "AxWild"], "2825": ["Товар не подлежит возврату после покупки. Но отчего силиконовая часть как будто бы в масле вымазанна? и трещенки или царапки с внутренней стороны... Может заводская смазка?.. Может кто прояснит ситуацию. Отказалась. ", "2017-11-04T14:23:53.012+03:00", "салатовый", "0", 7, 20, 3, "Щипцы кухонные, до 220С", "AxWild"], "2826": ["Отличные щипцы! Удобные для руки!", "2017-10-28T22:54:58.108+03:00", "сиреневый", "0", 24, 4, 5, "Щипцы кухонные, до 220С", "AxWild"], "2827": ["Щипцы на самом деле очень удобные! Хочу взять ещё на подарочек.Советкю всем!", "2017-10-27T12:29:39.226+03:00", "оранжевый", "0", 26, 4, 5, "Щипцы кухонные, до 220С", "AxWild"], "2828": ["Спасибо Бернеру - и магазину - и Татьяне! Прочла отзыв - и так воодушевилась - что заказала с доставкой прямо на следующий же день ! Подобные щипцы у меня есть - но захотелось именно от любимейшего Бернера . Ну вот - такой простой гаджет - и такая небольшая денежка за него - а столько удовольствия! Гораздо удобнее - небольшие - не тяжелые - в руке так приятно - такие эргономичные ! Ладненькие такие. И качественные. Отличные.", "2017-10-15T17:28:14.137+03:00", "сиреневый", "0", 15, 0, 5, "Щипцы кухонные, до 220С", "AxWild"], "2829": ["Сначала заказала цвета фуксии. \"Увели\" прямо  с кухни-вернее - я сама с удовольствием подарила гостье - увидев - как ей понравились. Теперь приехали оранжевые - пусть будут под цвет моего оранжевого комплекта. Цвет такой яркий и радостный! СИЛИКОНОВЫЕ ВСТАВКИ на ручках настолько приятные...Качественная вещь. Спасибо.", "2017-10-20T12:44:28.53+03:00", "сиреневый", "0", 8, 0, 5, "Щипцы кухонные, до 220С", "AxWild"], "2830": ["Слуууууууууууушайте, а где мои глаза были предыдущие сто лет, или раньше такого не продавалось? Сначала даже не поняла насколько они хороши: как только доставили, сразу попыталась айти им применение и попробовать  в действии. Готовила ужин: и куриные крылья ими переворачивала, и салат мешала, и раскладывала по тарелкам. Реально очень удобно! Обнаружила что и как хранить придумали: есть колечко-фиксатор, которыое держит их в закрытом виде, когда они висят у меня на крючке. Короче всё, что лопаткой не удобно – сваливается и не поддевается – то щипцами на ура. Кучу других лопаток и  ложек заменяют. Компактные, красивые, очень рада приобретению!!!!", "2017-10-10T12:58:49.009+03:00", "оранжевый", "0", 103, 14, 5, "Щипцы кухонные, до 220С", "AxWild"]}
